// CoreServer is the server API for Core service.
type CoreServer interface {
	// GetPaymentPlan makes request to the Planning service by passing it a list
	// of PaymentTasks and expects to receive a list of PaymentPlans
	GetPaymentPlan(context.Context, *GetPaymentPlanRequest) (*common.PaymentPlanResponse, error)
	// Notify Users about upcoming payment actions
	NotifyUsersUpcomingPaymentActions(context.Context, *NotifyUsersUpcomingPaymentActionsRequest) (*NotifyUsersUpcomingPaymentActionsResponse, error)
	// GetWaterfallOverview accepts a request from Core service with a user ID to create a waterfall overview for the
	// coming 12 month
	GetWaterfallOverview(context.Context, *planning.GetUserOverviewRequest) (*planning.WaterfallOverviewResponse, error)
	// Get the percentage of amount which has been paid of all active PaymentPlans for a given user ID
	GetAmountPaidPercentage(context.Context, *planning.GetUserOverviewRequest) (*planning.GetAmountPaidPercentageResponse, error)
	// Get the percentage of current balance which is covered by active plans for a given user ID
	GetPercentageCoveredByPlans(context.Context, *planning.GetUserOverviewRequest) (*planning.GetPercentageCoveredByPlansResponse, error)
	ListUserPaymentPlans(context.Context, *common.ListUserPaymentPlansRequest) (*common.ListPaymentPlanResponse, error)
	//  CRUD METHODS
	// Account
	CreateAccount(context.Context, *CreateAccountRequest) (*Account, error)
	GetAccount(context.Context, *GetAccountRequest) (*Account, error)
	GetDebitAccountBalance(context.Context, *GetDebitAccountBalanceRequest) (*GetDebitAccountBalanceResponse, error)
	IsDebitAccountLinked(context.Context, *IsDebitAccountLinkedRequest) (*IsDebitAccountLinkedResponse, error)
	IsCreditAccountLinked(context.Context, *IsCreditAccountLinkedRequest) (*IsCreditAccountLinkedResponse, error)
	ListAccounts(context.Context, *ListAccountRequest) (*ListAccountResponse, error)
	ListUserAccounts(context.Context, *ListUserAccountsRequest) (*ListAccountResponse, error)
	// Transaction
	CreateTransaction(context.Context, *CreateTransactionRequest) (*Transaction, error)
	GetTransaction(context.Context, *GetTransactionRequest) (*Transaction, error)
	ListTransactions(context.Context, *ListTransactionRequest) (*ListTransactionResponse, error)
	ListUserTransactions(context.Context, *ListUserTransactionsRequest) (*ListTransactionResponse, error)
	//Payment Task
	CreatePaymentTask(context.Context, *common.CreatePaymentTaskRequest) (*common.PaymentTask, error)
	CreateManyPaymentTask(context.Context, *common.CreateManyPaymentTaskRequest) (*common.CreateManyPaymentTaskResponse, error)
	GetPaymentTask(context.Context, *common.GetPaymentTaskRequest) (*common.PaymentTask, error)
	ListPaymentTasks(context.Context, *common.ListPaymentTaskRequest) (*common.ListPaymentTaskResponse, error)
	UpdatePaymentTask(context.Context, *common.UpdatePaymentTaskRequest) (*common.PaymentTask, error)
	DeletePaymentTask(context.Context, *common.DeletePaymentTaskRequest) (*common.DeletePaymentTaskResponse, error)
	// Users
	GetUser(context.Context, *GetUserRequest) (*User, error)
	GetUserByEmail(context.Context, *GetUserByEmailRequest) (*User, error)
	ListUsers(context.Context, *ListUserRequest) (*ListUserResponse, error)
	UpdateUser(context.Context, *UpdateUserRequest) (*User, error)
	DeleteUser(context.Context, *DeleteUserRequest) (*DeleteUserResponse, error)
}

